import React, { useEffect, useState } from "react";
import { makeStyles } from "@material-ui/core/styles";
import axios from "axios";
import { Typography, Card, CardContent, Grid } from "@material-ui/core";

const useStyles = makeStyles(theme => ({
  paper: {
    padding: theme.spacing(1)
  }
}));

export default function Acceuil() {
  const classes = useStyles();
  let carte;

  useEffect(() => {
    axios.post("http://localhost:4000/articles/recherche").then(resultat => {
      for (let i = 0; i < resultat.data.length; i++) {
        carte(
          <div>
            {carte}
            <Grid item xs={2} className={classes.paper}>
              <Card>
                <CardContent>
                  <Typography>{resultat.data[i].nom}</Typography>
                  <Typography>{resultat.data[i].quantite}</Typography>
                  <Typography>{resultat.data[i].prix}</Typography>
                </CardContent>
              </Card>
            </Grid>
          </div>
        );
      }
    });
  });

  return (
    <Grid container direction="row">
      {carte}
    </Grid>
  );
}
